import { Grid , Container} from '@mui/material';
import React from 'react';
import MyCard from '../molecules/MyCard';
interface Props{

}
const NewlyAdded=(props:Props) =>{
    return (
       <>
       <Container  style={{paddingLeft:"7%",paddingRight:"7%"}}>
           <Grid container rowSpacing={2} >
           <Grid item xs={12} sm={6} md={4}>
        <MyCard id={1} button='add' progressBar='none' src='7.png' name="The Lonely Century" author="Noreena Hertz" duration="15"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <MyCard id={2} button='add' progressBar='none' src='8.png' name="Eat Better, Feel Better" author="Giada De Laurentiis" duration="13" noOfReads="1.9"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <MyCard id={3} button='add' progressBar='none' src='9.png' name="Dropshipping" author="James Moore" duration="12"/>
        </Grid>
</Grid>
        </Container>
       </>
    );
}

export default NewlyAdded;
